import base64
import vertexai
from vertexai.preview.generative_models import GenerativeModel, Part


def generate():
    model = GenerativeModel("gemini-pro-vision")
    responses = model.generate_content(
        [image1, """according to image what is stool color?"""],
        generation_config={
            "max_output_tokens": 2048,
            "temperature": 0.4,
            "top_p": 1,
            "top_k": 32
        },
        stream=True,
    )

    for response in responses:
        print(response.text, end="")


image1 = Part.from_data(data=base64.b64decode(
    """"""),
                        mime_type="image/png")

generate()